import React from 'react';
import {BrowserRouter, Route, Link} from 'react-router-dom'
import Auth from './../Auth/Auth'

function HomePage () {
  return (
    <div>
      <BrowserRouter>
        <div>
          <Link to="/auth">Auth</Link>
        </div>
      </BrowserRouter>
    </div>
  )
}

export default HomePage
